(89, 'Strange Clouds - Delta 8 950mg - Raspberry Runtz', 'The Plugg', 31, 33, 'Raspberry Runtz (Hybrid) - Raspberry Runtz is yet another sun-grown Hybrid sweet candy lineage creation, this time fused with the Raspberry Kush strain. According to some, this bud can enhance your mood and get you in a mindset to achieve your goals. Raspberry Runtz has the potential to provide increased levels of focus and energy but won\'t leave you with the jitters.', '1pcs$;2pcs$;3pcs', '42$;84$;126', 1, 1, 'product/thump_6132714b5388c1630695755.png', 'product/0delta 8 - whitee & orange rasberry SC small-min.png', '2021-08-10 16:02:33', 5, 0),
(90, 'Strange Clouds - Delta 8 950mg - Watermelon Gusher', 'The Plugg', 31, 33, 'Watermelon Gusher (Indica) - Watermelon Gusher is a slightly Indica dominant hybrid strain (60% indica/40% sativa) created through crossing the classic Gelato #41 with Triangle Kush strains. Named for the delicious candy, Watermelon Gushers brings on the flavors with a combination of sour tropical fruits and rich creamy cookies in each and every drag.', '1pcs$;2pcs$;3pcs', '42$;84$;126', 1, 1, 'product/thump_613270fe740011630695678.png', 'product/0delta 8 - whitee & orange package SC small-min.png', '2021-08-10 16:04:27', 5, 0),
(91, 'Strange Clouds - Delta 8 950mg - Strawberry Shortcake', 'The Plugg', 31, 33, 'Strawberry Shortcake (Indica) - Strawberry Shortcake is an indica strain made by crossing White Wookie with The White. This strain provides euphoric effects that put your mind into a state of bliss. Strawberry Shortcake features a strong and hearty strawberry flavor that will have you craving more. This strain is ideal for nighttime use or during the evening when you have nothing of importance to do. Some users choose Strawberry Shortcake to help relieve symptoms associated with insomnia.', '1pcs$;2pcs$;3pcs', '42$;84$;126', 1, 1, 'product/thump_613270c413feb1630695620.png', 'product/0delta 8 - whitee & orange package small-min.png', '2021-08-10 16:06:16', 5, 0),
(92, 'Strange Clouds - Delta 8 950mg - Tropical Runtz', 'The Plugg', 31, 33, 'Tropical Runtz (Hybrid) - Tropical Runtz is a potent hybrid marijuana strain made by crossing Gelato and Zkittlez. Tropical Runtz produces long-lasting effects that are relaxing and tingly. This strain features a sweet flavor profile that coats your senses. Some users have commented that it has helped them with chronic pain, anxiety and stress.', '1pcs$;2pcs$;3pcs', '42$;84$;126', 1, 1, 'product/thump_6132708b5f83c1630695563.png', 'product/0delta 8 - whitee & green package small-min.png', '2021-08-10 16:07:54', 5, 0),
(93, 'Strange Clouds - Delta 8 950mg - Birthday Cake', 'The Plugg', 31, 33, 'Birthday Cake (Indica) - Birthday Cake is an indica-dominant hybrid with strong body effects and sweet cake-like flavor. As decadent as its Girl Scout Cookies and Cherry Pie parent strains, Birthday Cake Kush is the perfect way to end your day. Some users choose Birthday Cake to soothe the body without sedating the mind.', '1pcs$;2pcs$;3pcs', '42$;84$;126', 1, 1, 'product/thump_613270507946c1630695504.png', 'product/0delta 8 white & pink package small-min.png', '2021-08-10 16:09:37', 5, 0),
(94, 'Strange Clouds - Delta 8 950mg - Lemon OG', 'The Plugg', 31, 33, 'Lemon OG (Indica) - What this skunky indica lacks in longevity it makes up for in speed. A cross between the mythical Las Vegas Lemon Skunk and The OG #18, Lemon OG has been said to provide users with a quick-acting sleepy head sensation. While Lemon OG has inherited a skunky aroma from its kush relatives, this particular strain is mild tasting and pleasant smelling with fruity undertones.', '1pcs$;2pcs$;3pcs', '42$;84$;126', 1, 1, 'product/thump_61326fee295d91630695406.png', 'product/0delta 8 white & yellow package small-min.png', '2021-08-10 16:11:06', 5, 0),
(95, 'Watermelon Delta 8 Pot Rocks (100mg)', 'The Plugg', 26, 33, 'This is a 20ct Display of Watermelon Delta 8 Pot Rocks by Hemp Living. Each single-serve packet contains 100mg of Delta 8 THC, secured in patented foil-lined packaging for freshness. This Next Generation Technology improves the absorption and availability of Delta 8, so you feel the effects quicker and they last longer than normal edibles. Enjoy a burst of Watermelon flavor as the Pot Rocks pop, fizz, and crackle with every mouthful. The industry has spoken. Pot Rocks is the future of Delta 8!', '1pcs$;2pcs$;3pcs', '16$;32$;48', 1, 1, 'product/thump_61326fa26e1f71630695330.png', 'product/0delta 8 pop rocks package image-min.png', '2021-08-10 16:13:47', 5, 0),
(96, 'Cake - Delta 8 Vape Disposable 940mg - Birthday Cake', 'The Plugg', 31, 33, 'Includes one 1-pack box of Cake Birthday Cake. Each disposable contains 940mg of Delta 8 THC and less than 0.3% Delta 9 THC.\r\nBirthday Cake is an Indica hybrid crossed between Girl Scout Cookies and Cherry Pie. Users have commented that this strain provides strong body effects while having a sweet cake-like flavor.', '1pcs$;2pcs$;3pcs', '42$;84$;126', 1, 1, 'product/thump_61326f5ce56d71630695260.png', 'product/0cake - white & red package-min.png', '2021-08-10 16:16:07', 5, 0),
(97, 'Caviar By Cake - Delta 8 Vape 940mg - Pineapple Upside Down', 'The Plugg', 31, 33, 'Pineapple Upside Down Cake (Hybrid) - Pineapple Upside Down Cake is a Hybrid strain made by crossing Pineapple Trainwreck with Cookie Monster. This strain has been known to produce effects that relax muscles, relieve tension, and improves mood. Pineapple Upside Down Cake smells like the pastry of its namesake with a sharp, loud aroma that is delicious and unique. Some users choose this strain to relieve symptoms associated with chronic pain, inflammation, and depression.', '1pcs$;2pcs$;3pcs', '42$;84$;126', 1, 1, 'product/thump_61326f37a002c1630695223.png', 'product/0cake - blue package small image-min.png', '2021-08-10 16:18:19', 5, 0),
